import React, { Component } from 'react'

export default class About extends Component {
  render() {
    return (
      <div>
        <p>Hi! I'm Kavan Bansal.</p>
        <p>I am a third-year undergraduate student at Johns Hopkins</p>
        <p>Majors: Computer Science, Computer Engineering</p>
        <p>Minors: Entrepreneurship and Management, Applied Mathematics and Statistics</p>
      </div>
    )
  }
}
